            hostNameTakens[0] = hostNameTakens[0].replace("global-", "");
            hostNameTakens[0] += "-api";
            var apiHostName = hostNameTakens.join(".");
            return protocol + "//" + apiHostName;
        }

            promise.resolve = function (result) {
